	line-height: 30px;
	background-color: blue;
	border-radius: 50%;
	color: white;
	box-shadow: 0px 0px 5px black;
	display: none;
}
.multi-range-slider .thumb:active * {
	display: block;
}
.input-type-range {
	position: absolute;
	top: 0px;
	left: 0px;
	width: 100%;
	opacity: 0;
	pointer-events: none;
}

.multi-range-slider .ruler {
	margin: 10px 0px -5px 0px;
